import React from "react";

import './navbar.css';

const Navbar = () => {
    return (
        <div className='navbar'>
            <p className='navbar__title'>Содержание статьи:</p>
            <ul className='navbar__list'>
                <li><span className='navbar__number'>1.</span> Опасность остеопороза</li>
                <li><span className='navbar__number'>2.</span> Группа и факторы риска</li>
                <li><span className='navbar__number'>3.</span> Симптомы и проявления</li>
                <li><span className='navbar__number'>4.</span> Типы остеопороза</li>
                <li><span className='navbar__number'>5.</span> Диагностика</li>
                <li><span className='navbar__number'>6.</span> Профилактика и лечение</li>
                <li><span className='navbar__number'>7.</span> Препараты</li>
                <li><span className='navbar__number'>8.</span> Побочные эффекты и их устранение</li>
                <li><span className='navbar__number'>9.</span> Золедронаты</li>
                <li><span className='navbar__number'>10.</span> Дозировка</li>
                <li><span className='navbar__number'>11.</span> Эффективность</li>
                <li><span className='navbar__number'>12.</span> Длительность лечения</li>
                <li><span className='navbar__number'>13.</span> Удобство использования</li>
            </ul>
        </div>
    )
};

export default Navbar;
